LineComment.Text:
 IF #R_TRIG_ExePos.Q THEN
    #statExePos := TRUE;
ELSIF #F_TRIG_Ready.Q THEN
    #statExePos := FALSE;
END_IF;

 IF #statExePos AND #TON_PositionSelected.Q AND #Ready THEN
    #Start := TRUE;
ELSIF NOT #Ready THEN
    #Start := FALSE;
END_IF;

IF #R_TRIG_ExeHome.Q AND #Ready THEN
    #DoHoming := TRUE;
ELSIF #F_TRIG_Ready.Q THEN
    #DoHoming := FALSE;
END_IF;

 IF #R_TRIG_Ready.Q THEN
    #InPosition := TRUE;
ELSIF #R_TRIG_ExePos.Q THEN
    #InPosition := FALSE;
END_IF;
